    "2013-03-19T00:36:33.507493",nt"name": "geologic-map-of-the-eagle-a-1-quadrangle-fortymile-mining-district",nt"isopen":
    false,nt"url": null,nt"notes": "This geologic map was produced by merging
    a bedrock geologic map and a surficial geologic map of the Eagle A-1 Quadrangle.
    Surficial geologic units were determined by a combination of air photo interpretation
    and site-specific field investigations. Bedrock geologic units were determined by
    using a combination of airborne magnetic and electromagnetic surveys, several months
    of fieldwork, geochemical data, and laboratory investigations. These maps are the
    result of new field investigations by DGGS in 1999 and 2001.",nt"license_title":
